Ad Text:
Role Overview:
We are seeking an experienced Business Analyst to join our dynamic team to work with one of our clients in Adelaide (based approx. 5km from the CBD). The ideal candidate will have prior experience in a similar role and be comfortable and confident in a range of stakeholder management.

Key Responsibilities:

Translate business needs into functional and technical specifications;
Lead workshops to gather and analyse business and stakeholder requirements;
Develop high-quality artefacts including user stories, acceptance criteria, prototypes and process maps;
Assist with change management and training documentation.
